<p>reduced?</p>
<h2>Usage</h2>
<p>builtin-function</p>
<h2>Syntax</h2>
<p><code>
(<strong>reduced?</strong> <em>obj</em>)</code><br/></p>
<h2>Description</h2>
<p>Returns <code>true</code> if <code>obj</code> was created by <code>reduced</code>.</p>
